"original": |2-
     The requested resource resides temporarily at the URI given by the
     Location header.  This response is intended to be used for many types
     of temporary redirects, e.g., load balancing.  It is RECOMMENDED that
     the server set the reason phrase to something more meaningful than
     "Found" in these cases.  The Location header MUST be included in the
     response.  The user agent SHOULD redirect automatically to the given
     URI.  This response MUST NOT contain a message body.
"fixed": |-
  The requested resource resides temporarily at the URI given by the Location header.  This response is intended to be used for many types of temporary redirects, e.g., load balancing.  It is RECOMMENDED that the server set the reason phrase to something more meaningful than "Found" in these cases.  The Location header MUST be included in the response.  The user agent SHOULD redirect automatically to the given URI.  This response MUST NOT contain a message body.
"ko": |-
  요청된 리소스는 Location 헤더에 제공된 URI에 일시적으로 상주합니다. 이 응답은 로드 밸런싱과 같은 다양한 유형의 임시 리디렉션에 사용하기 위한 것입니다. 이러한 경우 서버는 이유 문구를 "발견됨"보다 더 의미 있는 것으로 설정하는 것이 좋습니다. Location 헤더는 응답에 포함되어야 합니다. 사용자 에이전트는 지정된 URI로 자동으로 리디렉션되어야 합니다. 이 응답에는 메시지 본문이 포함되어서는 안 됩니다.
